import React from 'react';
import styled from 'styled-components'

const Postings = (props)=>{
    return(
        <Wrapper>
            <Text>{props.Title}</Text>
        </Wrapper>
    )
}

export default Postings

const Wrapper = styled.section`
display:flex;
flex-direction: row;
align-items:center;
`
const Text = styled.p`
`;
